import Main from './components/Main'
import LoginPage from './components/LoginPage'
import RegistrPage from './components/RegistrPage'

function App() {
  return (
  <Router>
      <Routes>
        <Route path="/" element={<Main />} />
        <Route path="login" element={<LoginPage />} />
      </Routes>
  </Router>
  );
}

export default App;
